import classes from './Form.module.css';

const Form = () => {
  return (
    <div className={classes.form}>
      <form>
        <label for="title">Title</label>
        <select>
          <option value="mr">Mr.</option>
          <option value="ms">Ms.</option>
        </select>

        <button type="submit" class="button">
          Search
        </button>
      </form>
    </div>
  );
};

export default Form;
